import React from 'react';

function MainButtonElement(props) {

    return(
        <div>
            <input required value={props.name} onChange={(e)=> props.setName(e.target.value)}  type="text" placeholder='Digite o nome do Pokemon'></input>
            <button type='submit' onClick={props.handlerSubmit}>Buscar</button>
        </div>
    );
}

export default MainButtonElement;
